{'sentences': ["Business & Tech Raising Cane's Requests Change To Milford Parking Requirements", 'A fast-food restaurant planning a location at a former Milford Bank branch is requesting a change to parking regulations.

', 'A fast-food restaurant planning a location in Milford is requesting a change to parking regulations.', 'The current owner of the property, 1455 BPR, LLC, noted in a petition requesting the change that there is no distinction in the parking requirements for fast-food restaurants.', '"In light of the existing definition, as well as modern drive-through habits, it makes little sense to require a 'fast-food restaurant' to provide the same number of parking spaces that a regular sit-down restaurant would be required to provide," the petition stated.

']}
